import React from "react";

const Selector = (props) => {
  return (
    <div className="h-20 pl-4 pr-4 grid grid-cols-3 gap-4 content-center">
      <button
        onClick={props.allTime}
        className="bg-blue-500 hover:-translate-y-1 hover:scale-110 hover:bg-indigo-500 duration-300 text-white font-bold py-2 px-4 rounded transition ease-in-out delay 150"
      >
        All Time
      </button>
      <button
        onClick={props.sixMonths}
        className="bg-blue-500 hover:-translate-y-1 hover:scale-110 hover:bg-indigo-500 duration-300 text-white font-bold py-2 px-4 rounded transition ease-in-out delay 150"
      >
        Past 6 Months
      </button>
      <button
        onClick={props.lastMonth}
        className="bg-blue-500 hover:-translate-y-1 hover:scale-110 hover:bg-indigo-500 duration-300 text-white font-bold py-2 px-4 rounded transition ease-in-out delay 150"
      >
        Last Month
      </button>
    </div>
  );
};

export default Selector;
